export function getColliderObjects() {
  const colliders: ObjectBase[] = []
  const map: number[][] = []
  for (let x = 0; x < collidersIndex.length; x += 100)
    map.push(collidersIndex.slice(x, 100 + x))
  map.forEach((row, y) => {
    row.forEach((symbol, x) => {
      if (symbol) {
        const size = 48

        const temp = new ColliderObjects(new Vector2(x * size, y * size), size, size);
        colliders.push(temp)
      }
    })
  })
  return colliders || []
}